import React from 'react'
import App from './App';



const Logout = (e) =>{
  e.preventDefault();
  <App Auth={false}/>
}
const Mainpage = () => {
  return (
    <div>LOG IN YPOU
      <button onClick={Logout}>Logout</button>
    </div>
    
  )
}

export default Mainpage
